D' else input_data_path_original\n            transformed_data = transform_initial.extract_transform(table_name=table_name,\n                                                                   data_path=input_data)\n\n            # Load custom to HDF5 and Parquet\n            load_initial.load(data=transformed_data,\n                              table_name=table_name,\n                              data_path=output_data_path,\n                              load_to_hdf5=environment_name == 'local')\n\n            peak_memory_usage = round(tracemalloc.get_traced_memory()[1] / 1000000, 2)\n            execution_time_in_s = round(time.time() - start_time, 2)\n            print(f'Table {table_name}: {peak_memory_usage}MB | {execution_time_in_s}s')\n\n            tracemalloc.stop()\n\n        &lt;/pre&gt;\n        "},"id":"5280","type":"Div"},{"attributes":{"format":"0.0b"},"id":"5276","type":"NumeralTickFormatter"},{"attributes":{"children":[{"id":"5126"},{"id":"5159"},{"id":"5192"}],"sizing_mode":"stretch_both"},"id":"5278","type":"Column"},{"attributes":{"coordinates":null,"formatter":{"id":"5351"},"group":null,"major_label_policy":{"id":"5352"},"ticker":{"id":"5035"}},"id":"5034","type":"LinearAxis"},{"attributes":{"format":"0.0b"},"id":"5274","type":"NumeralTickFormatter"},{"attributes":{"tools":[{"id":"4964"},{"id":"4965"},{"id":"4966"},{"id":"4967"},{"id":"4980"}]},"id":"4969","type":"Toolbar"},{"attributes":{"child":{"id":"4947"},"title":"Scheduler Profile (administrative)"},"id":"5284","type":"Panel"},{"attributes":{"source":{"id":"4982"}},"id":"5015","type":"CDSView"},{"attributes":{},"id":"5360","type":"AllLabels"},{"attributes":{"child":{"id":"4983"},"title":"Worker Profile (administrative)"},"id":"5283","type":"Panel"},{"attributes":{"source":{"id":"4946"}},"id":"4979","type":"CDSView"},{"attributes":{"callback":null,"point_policy":"follow_mouse","tooltips":"\n            &lt;div&gt;\n                &lt;span style=\"font-size: 14px; font-weight: bold;\"&gt;N
